struct Node { // Ð¾Ð´Ð½Ð¾ÑÐ²ÑÐ·Ð½Ñ‹Ð¹ ÑÐ¿Ð¸ÑÐ¾Ðº ÑÐ¾ÑÑ‚Ð¾Ð¸Ñ‚ Ð¸Ð· ÑƒÐ·Ð»Ð¾Ð²
	int value; // ÑƒÐ·ÐµÐ» Ñ…Ñ€Ð°Ð½Ð¸Ñ‚ Ð¸Ð½Ñ„Ð¾Ñ€Ð¼Ð°Ñ‚Ð¸Ð²Ð½ÑƒÑŽ Ñ‡Ð°ÑÑ‚ÑŒ
	Node* next; // ÑƒÐºÐ°Ð·Ð°Ñ‚ÐµÐ»ÑŒ Ð½Ð° ÑÐ»ÐµÐ´ÑƒÑŽÑ‰Ð¸Ð¹ ÑƒÐ·ÐµÐ»
